  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes the results of an
  arctic nesting goose study conducted on Kigigak Island as part of a Refuge-wide
  waterfowl monitoring program. The goals of this waterfowl monitoring effort are
  to: evaluate waterfowl productivity, particularly of Brant, Cackling Canada Geese,
  Emperor Geese, and Greater White-fronted Geese; and to determine both qualitatively
  and quantitatively what mortality factors influence goose nesting populations on
  the Yukon-Kuskokwim Delta. A description of the area and survey methods are given,
  as well as a discussion of survey results and recommendations.\",\n\t\"owner_org\":
